import React, { useEffect, useState } from 'react';

function CatalogPage() {
  const [submittedTexts, setSubmittedTexts] = useState([]);

  useEffect(() => {
    // Retrieve submitted texts from local storage when component mounts
    const texts = JSON.parse(localStorage.getItem('submittedTexts')) || [];
    setSubmittedTexts(texts);
  }, []); // Empty dependency array means this useEffect runs once when component mounts

  return (
    <div className="catalog-container">
      {submittedTexts.map((text, index) => (
        <div key={index} className="text-box">
          {text}
        </div>
      ))}
    </div>
  );
}

export default CatalogPage;
